import React, { Component } from "react";

import '../../App.css';

import * as videoStyles from  "../../styles/video";

class Home extends Component {

    constructor(props){
        super(props);       
      
    }
 
  


    render() {
             
        return (
        <div style={videoStyles.videoContainer} >
           <iframe style={videoStyles.video} width="800" height="400" src="https://295-videos.s3.us-east-2.amazonaws.com/San-Jose-16th-Oct-2019.mp4"></iframe>
        </div>
            

        );
    }
}



export default Home;
